import React, { useState } from 'react';
import './HealthProfiles.css';

function HealthProfiles() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [activeTab, setActiveTab] = useState('overview');

  // Mock user data - in a real app, this would come from a backend API
  const userData = {
    name: "John Doe",
    age: 35,
    gender: "Male",
    height: "175 cm",
    weight: "72 kg",
    bmi: "23.5",
    bloodType: "O+",
    allergies: ["Peanuts", "Penicillin"],
    conditions: ["Mild Hypertension"],
    predictions: [
      { date: "2025-06-01", risk: "Low risk of cardiovascular disease", score: 18 },
      { date: "2025-05-15", risk: "Moderate risk of type 2 diabetes", score: 42 },
      { date: "2025-04-22", risk: "Low risk of respiratory issues", score: 15 }
    ],
    trends: {
      bloodPressure: [
        { date: "2025-06-01", value: "120/80" },
        { date: "2025-05-15", value: "124/82" },
        { date: "2025-04-22", value: "128/84" }
      ],
      weight: [
        { date: "2025-06-01", value: "72 kg" },
        { date: "2025-05-15", value: "73 kg" },
        { date: "2025-04-22", value: "74 kg" }
      ]
    }
  };

  // Login form state
  const [loginForm, setLoginForm] = useState({
    email: '',
    password: ''
  });

  const handleLogin = (e) => {
    e.preventDefault();
    // In a real app, this would authenticate with a backend
    setIsLoggedIn(true);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setLoginForm(prev => ({
      ...prev,
      [name]: value
    }));
  };

  if (!isLoggedIn) {
    return (
      <section id="profiles" className="health-profiles">
        <h2>User Health Profiles</h2>
        <p className="section-description">
          Secure health records and prediction history for each user, offering insights and trend analysis over time.
        </p>

        <div className="login-container">
          <h3>Login to Access Your Health Profile</h3>
          <form onSubmit={handleLogin} className="login-form">
            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input 
                type="email" 
                id="email" 
                name="email" 
                value={loginForm.email} 
                onChange={handleInputChange} 
                required 
              />
            </div>
            <div className="form-group">
              <label htmlFor="password">Password</label>
              <input 
                type="password" 
                id="password" 
                name="password" 
                value={loginForm.password} 
                onChange={handleInputChange} 
                required 
              />
            </div>
            <button type="submit" className="login-button">Login</button>
          </form>
          <p className="login-help">
            Don't have an account? <a href="#signup">Sign up</a> | <a href="#forgot">Forgot password?</a>
          </p>
        </div>
      </section>
    );
  }

  return (
    <section id="profiles" className="health-profiles">
      <h2>Your Health Profile</h2>

      <div className="profile-container">
        <div className="profile-header">
          <div className="profile-avatar">
            <i className="fas fa-user-circle"></i>
          </div>
          <div className="profile-info">
            <h3>{userData.name}</h3>
            <p>{userData.age} years • {userData.gender} • {userData.bloodType}</p>
          </div>
        </div>

        <div className="profile-tabs">
          <button 
            className={activeTab === 'overview' ? 'active' : ''} 
            onClick={() => setActiveTab('overview')}
          >
            Overview
          </button>
          <button 
            className={activeTab === 'predictions' ? 'active' : ''} 
            onClick={() => setActiveTab('predictions')}
          >
            Risk Predictions
          </button>
          <button 
            className={activeTab === 'trends' ? 'active' : ''} 
            onClick={() => setActiveTab('trends')}
          >
            Health Trends
          </button>
        </div>

        <div className="profile-content">
          {activeTab === 'overview' && (
            <div className="overview-tab">
              <div className="metrics-grid">
                <div className="metric-card">
                  <h4>Height</h4>
                  <p>{userData.height}</p>
                </div>
                <div className="metric-card">
                  <h4>Weight</h4>
                  <p>{userData.weight}</p>
                </div>
                <div className="metric-card">
                  <h4>BMI</h4>
                  <p>{userData.bmi}</p>
                </div>
                <div className="metric-card">
                  <h4>Blood Type</h4>
                  <p>{userData.bloodType}</p>
                </div>
              </div>

              <div className="health-section">
                <h4>Allergies</h4>
                <ul className="tag-list">
                  {userData.allergies.map((allergy, index) => (
                    <li key={index} className="tag">{allergy}</li>
                  ))}
                </ul>
              </div>

              <div className="health-section">
                <h4>Medical Conditions</h4>
                <ul className="tag-list">
                  {userData.conditions.map((condition, index) => (
                    <li key={index} className="tag">{condition}</li>
                  ))}
                </ul>
              </div>
            </div>
          )}

          {activeTab === 'predictions' && (
            <div className="predictions-tab">
              <h3>Your Health Risk Predictions</h3>
              <div className="predictions-list">
                {userData.predictions.map((prediction, index) => (
                  <div key={index} className="prediction-card">
                    <div className="prediction-date">{prediction.date}</div>
                    <div className="prediction-risk">{prediction.risk}</div>
                    <div className="risk-meter">
                      <div 
                        className="risk-level" 
                        style={{
                          width: `${prediction.score}%`,
                          backgroundColor: prediction.score < 30 ? '#2ecc71' : 
                                          prediction.score < 70 ? '#f39c12' : '#e74c3c'
                        }}
                      ></div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}

          {activeTab === 'trends' && (
            <div className="trends-tab">
              <h3>Your Health Trends</h3>

              <div className="trend-section">
                <h4>Blood Pressure</h4>
                <div className="trend-data">
                  {userData.trends.bloodPressure.map((item, index) => (
                    <div key={index} className="trend-point">
                      <div className="trend-date">{item.date}</div>
                      <div className="trend-value">{item.value}</div>
                    </div>
                  ))}
                </div>
              </div>

              <div className="trend-section">
                <h4>Weight</h4>
                <div className="trend-data">
                  {userData.trends.weight.map((item, index) => (
                    <div key={index} className="trend-point">
                      <div className="trend-date">{item.date}</div>
                      <div className="trend-value">{item.value}</div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </section>
  );
}

export default HealthProfiles;
